@-moz-document domain("roblox.com") {
@keyframes rainbow {
    0% {
        background-color: #92b2fc;
        border-color: #92b2fc;
    }
    14% {
        background-color: #92fc9e;
        border-color: #92fc9e;
    }
    28% {
        background-color: #92b2fc;
        border-color: #92b2fc;
    }
    42% {
        background-color: #92fc9e;
        border-color: #92fc9e;
    }
    56% {
        background-color: #92b2fc;
        border-color: #92b2fc;
    }
    80% {
        background-color: #92fc9e;
        border-color: #92fc9e;
    }
    94% {
        background-color: #92b2fc;
        border-color: #92b2fc;
    }
    100% {
        background-color: #92fc9e;
        border-color: #92fc9e;
    }
}
.btn-common-play-game-lg {
    animation: rainbow 10s infinite;
}
}
